import React, { useState} from 'react';
import {Welcome, Register} from './pages/index.js';

function App() {
  const [currentForm, setCurrentForm] = useState('Welcome');

  return (
    <div>
      {
        currentForm === "Welcome" ? <Welcome/> : <Register/>
      }
    </div>
  );
}

export default App;
